import '../css/page18.css';
import React from 'react'
import anime from "animejs";

function Page18(props){
  let objs = document.getElementsByClassName('Page18Node');
  [].forEach.call(objs, element => element.style.opacity = 0);
  let objs3 = document.getElementsByClassName('Page18Log');
  [].forEach.call(objs3, element => element.style.opacity = 0);
  let objs4 = document.getElementsByClassName('Page18Signal');
  [].forEach.call(objs4, element => element.style.display = '');

  function animation(){

    let animation1 = anime.timeline().add({
      targets: '#Page18Signal1',
      opacity: 1,
      translateX: 108,
      translateY: -22,
      easing: "linear",
      duration: 0,
    }).add({
      targets: '#Page18Signal1',
      translateX: 7,
      translateY: 179,
      easing: "linear",
      duration: 2500,
      complete: function () {
        let obj1 = document.querySelector('#Page18Signal1');
        obj1.style.display = 'none';
        anime({
          targets: '#Page18Signal1',
          opacity: 0,
          translateX: 108,
          translateY: -22,
          easing: "linear",
          duration: 0,
        });
      }
    });

    let animation2 = anime.timeline().add({
      targets: '#Page18Signal2',
      opacity: 1,
      translateX: 207,
      translateY: 179,
      easing: "linear",
      duration: 0,
    }).add({
      targets: '#Page18Signal2',
      translateX: 7,
      easing: "linear",
      duration: 2500,
      complete: function() {
        let obj1 = document.querySelector('#Page18Signal2');
        obj1.style.display = 'none';
        let anime1 = anime({
          targets: '#Page18Signal2',
          opacity: 0,
          translateX: 207,
          translateY: 179,
          easing: "linear",
          duration: 0,
        });
      }
    });

    let animation3 = anime.timeline().add({
      targets: '#Page18Text1',
      scaleX: [1, 0],
      opacity: [1, 0],
      easing: "easeOutExpo",
      duration: 500,
    }, '+=3000').add({
      targets: '#Page18Text2',
      scaleX: [0, 1],
      opacity: [0, 1],
      easing: "easeInExpo",
      duration: 500,
    }).add({
      targets: '#Page18Text2',
      scaleX: [1, 0],
      opacity: [1, 0],
      easing: "easeOutExpo",
      duration: 500,
      delay: 2000,
    }).add({
      targets: '#Page18Text3',
      scaleX: [0, 1],
      opacity: [0, 1],
      easing: "easeInExpo",
      duration: 500,
    });
  }
  if(props.display) animation();


  return(
      <div style={{display: props.display?'': 'none'}}>
        <div className="Page18Node" id="Page18Node1"/>
        <div className="Page18NodeDes" id="Page18NodeDes1">
          <div className="NodeDesContent"> Node a</div>
          <div className="NodeDesContent"> Term: 0</div>
        </div>
        <table className="Page18Log" id="Page18Log1">
          <tbody>
          <tr id="TR">
            <th>
              Log
            </th>
          </tr>
          <tr id="TR">
            <td>
              SET 5
            </td>
          </tr>
          </tbody>
        </table>

        <div className="Page18Node" id="Page18Node2"/>
        <div className="Page18NodeDes" id="Page18NodeDes2">
          <div className="NodeDesContent"> Node b</div>
          <div className="NodeDesContent"> Term: 0</div>
        </div>
        <table className="Page18Log" id="Page18Log2">
          <tbody>
          <tr id="TR">
            <th>
              Log
            </th>
          </tr>
          <tr id="TR">
            <td>
              SET 5
            </td>
          </tr>
          </tbody>
        </table>

        <div className="Page18NodeDes" id="Page18NodeDes3">
          <div className="NodeDesContent"> Node c</div>
          <div className="NodeDesContent"> Term: 0</div>
        </div>
        <div className="Page18Node" id="Page18Node3"/>
        <table className="Page18Log" id="Page18Log3">
          <tbody>
          <tr id="TR">
            <th>
              Log
            </th>
          </tr>
          <tr id="TR">
            <td>
              SET 5
            </td>
          </tr>
          </tbody>
        </table>
        <div className="Page18Client" id="Page18Client1"> 5 </div>
        <div className="Page18Signal" id="Page18Signal1"/>
        <div className="Page18Signal" id="Page18Signal2"/>
        <div className="Page18Text" id="Page18Text1"> All changes to the system now go through the leader. </div>
        <div className="Page18Text" id="Page18Text2"> Each change is added as an entry in the node's <span id="Focus">Log</span>.</div>
        <div className="Page18Text" id="Page18Text3"> This log entry is currently uncommitted so it won't update the node's value.</div>
      </div>
  );
}

export default Page18;
